import fs from "fs/promises";
import { GoogleGenerativeAI, Part } from "@google/generative-ai";
import { PrismaClient } from "@prisma/client";

const prisma = new PrismaClient();
const genAI = new GoogleGenerativeAI(process.env.GOOGLE_API_KEY);
const embeddingModel = "embedding-001";
const visionModel = genAI.getGenerativeModel({ model: "gemini-pro-vision" });

// Sample base64 image (you should replace this with your actual chart image)
const sampleChartBase64 =
  ""; // Add your base64 image here

// You can either:
// 1. Pass the base64 image as a command line argument
const base64Image = process.argv[2];

// 2. Or read it from a file
if (!base64Image) {
  try {
    const imageData = await fs.readFile("./chart-base64.txt", "utf8");
    analyzeChartWithRAG(imageData.trim());
  } catch (error) {
    console.error("Error reading image data:", error);
    console.log("\nTo use this script:");
    console.log("Option 1: node test-rag-with-image.mjs <base64-image-string>");
    console.log(
      "Option 2: Create a file named chart-base64.txt with your base64 image string",
    );
  }
} else {
  analyzeChartWithRAG(base64Image);
}

async function generateEmbedding(text) {
  const model = genAI.getGenerativeModel({ model: embeddingModel });
  const result = await model.embedContent(text);
  const embedding = await result.embedding;
  return embedding.values;
}

async function getRelevantKnowledge(query, category = null, limit = 3) {
  const queryEmbedding = await generateEmbedding(query);

  const whereClause = category ? `WHERE category = '${category}'` : "";

  const results = await prisma.$queryRaw`
    SELECT
      id,
      content,
      category,
      tags,
      metadata,
      1 - (embedding <=> ${JSON.stringify(queryEmbedding)}::vector) as similarity
    FROM trading_knowledge_embeddings
    ${prisma.sql([whereClause])}
    ORDER BY embedding <=> ${JSON.stringify(queryEmbedding)}::vector
    LIMIT ${limit}
  `;

  return results;
}

async function analyzeChartWithRAG(base64Image) {
  try {
    console.log(" Testing Image Analysis with RAG...\n");

    // Test scenarios
    const testScenarios = [
      {
        prompt:
          "Is there a double bottom pattern in this chart? If so, how should I trade it based on the pattern characteristics?",
        category: "PATTERN",
      },
      {
        prompt:
          "Based on this chart, what would be an appropriate position size and risk management strategy?",
        category: "RISK_MANAGEMENT",
      },
    ];

    for (const scenario of testScenarios) {
      console.log(`\n Testing scenario: "${scenario.prompt}"`);

      // Get relevant knowledge from RAG
      const relevantKnowledge = await getRelevantKnowledge(
        scenario.prompt,
        scenario.category,
      );

      // Format knowledge for context
      const context = relevantKnowledge
        .map(
          (
            k,
          ) => `${k.category} Knowledge (${(k.similarity * 100).toFixed(1)}% relevant):
${k.content}
Key Points from Metadata:
${JSON.stringify(k.metadata, null, 2)}`,
        )
        .join("\n\n");

      // Create parts for vision model
      const parts = [
        {
          inlineData: {
            data: base64Image,
            mimeType: "image/png",
          },
        },
        {
          text: `You are an expert trading analyst. Using the following trading knowledge as context:

${context}

Analyze this chart and answer: ${scenario.prompt}

Please provide a detailed analysis including:
1. Pattern identification and characteristics
2. Key support/resistance levels
3. Risk considerations from the knowledge base
4. Specific trading approach based on the provided knowledge
5. Position sizing and risk management recommendations`,
        },
      ];

      // Generate analysis
      const result = await visionModel.generateContent(parts);
      const response = await result.response;
      const text = response.text();

      console.log("\n Analysis Results:");
      console.log("-".repeat(80));
      console.log("Relevant Knowledge Used:");
      for (const k of relevantKnowledge) {
        console.log(
          `- ${k.category} (${(k.similarity * 100).toFixed(1)}% similarity)`,
        );
        console.log(`  Tags: ${k.tags.join(", ")}`);
      }
      console.log("\n AI Analysis:");
      console.log(text);
      console.log("-".repeat(80));
    }
  } catch (error) {
    console.error(" Error testing RAG with image:", error);
    console.error(error.stack);
  } finally {
    await prisma.$disconnect();
  }
}
